Pallet authors can annotate their dispatchable function with a weight using syntax like this, #[weight = <Some Weighting Instance>]
fn some_call(...) -> Result { // --snip--
} For simple transactions a fixed weight will do. Substrate allows simply specifying a constant integer in cases situations like this. decl_module! { pub struct Module<T: Config> for enum Call { #[weight = 10_000] fn store_value(_origin, entry: u32) -> DispatchResult { StoredValue::put(entry); Ok(()) } For more complex transactions, custom weight calculations can be performed that consider the parameters passed to the call. This snippet shows a weighting struct that weighs transactions where the first parameter is a bool. If the first parameter is true, then the weight is linear in the second parameter. Otherwise the weight is constant. A transaction where this weighting scheme makes sense is demonstrated in the kitchen. pub struct Conditional(u32); impl WeighData<(&bool, &u32)> for Conditional { fn weigh_data(&self, (switch, val): (&bool, &u32)) -> Weight { if *switch { val.saturating_mul(self.0) } else { self.0 } }
} In addition to the WeightData Trait , shown above, types that are used to calculate transaction weights must also implement ClassifyDispatch , and PaysFee . impl<T> ClassifyDispatch<T> for Conditional { fn classify_dispatch(&self, _: T) -> DispatchClass { // Classify all calls as Normal (which is the default) Default::default() }
} impl PaysFee for Conditional { fn pays_fee(&self) -> bool { true }
} The complete code for this example as well as several others can be found in the kitchen.

