We'll be using the most common approach which takes its fixed point implementation from Substrate itself. There are a few fixed-point structs available in Substrate, all of which implement the PerThing trait , that cover different amounts of precision. For this accumulator example, we'll use the PerMill struct which represents fractions as parts per million. There are also Perbill , PerCent , and PerU16 , which all provide the same interface (because it comes from the trait). Substrate's fixed-point structs are somewhat unique because they represent only fractional parts of numbers. That means they can represent numbers between 0 and 1 inclusive, but not numbers with whole parts like 2.718 or 3.14. To begin we declare the storage item that will hold our accumulated product. You can see that the trait provides a handy function for getting the identity value which we use to set the default storage value to 1. #[pallet::type_value]
pub(super) fn PermillAccumulatorDefaultValue<T: Config>() -> Permill { Permill::one()
} #[pallet::storage]
#[pallet::getter(fn permill_value)]
pub(super) type PermillAccumulator<T: Config> = StorageValue<_, Permill, ValueQuery, PermillAccumulatorDefaultValue<T>>; The only extrinsic for this Permill accumulator is the one that allows users to submit new Permill values to get multiplied into the accumulator. #[pallet::weight(10_000)]
pub fn update_permill( origin: OriginFor<T>, new_factor: Permill,
) -> DispatchResultWithPostInfo { ensure_signed(origin)?; let old_accumulated = Self::permill_value(); // There is no need to check for overflow here. Permill holds values in the range // [0, 1] so it is impossible to ever overflow. let new_product = old_accumulated.saturating_mul(new_factor); // Write the new value to storage PermillAccumulator::<T>::put(new_product); // Emit event Self::deposit_event(Event::PermillUpdated(new_factor, new_product)); Ok(().into())
} The code of this extrinsic largely speaks for itself. One thing to take particular note of is that we don't check for overflow on the multiplication. If you've read many of the recipes you know that a Substrate runtime must never panic, and a developer must be extremely diligent in always checking for and gracefully handling error conditions. Because Permill only holds values between 0 and 1, we know that their product will always be in that same range. Thus it is impossible to overflow or saturate. So we can happily use saturating_mul and move on.

115.body:
Substrate-fixed takes a more traditional approach in that their types represent numbers with both whole and fractional parts. For this implementation, we'll use the U16F16 type. This type contains an unsigned number (indicated by the U at the beginning) and has 32 total bits of precision - 16 for the integer part, and 16 for the fractional part. There are several other types provided that follow the same naming convention. Some examples include U32F32 and I32F32 where the I indicates a signed number, just like in Rust primitive types. As in the Permill example, we begin by declaring the storage item. With substrate-fixed, there is not a one function, but there is a from_num function that we use to set the storage item's default value. This from_num method and its counterpart to-num are your primary ways of converting between substrate-fixed types and Rust primitive types. If your use case does a lot of fixed-point arithmetic, like ours does, it is advisable to keep your data in substrate-fixed types. We're able to use U16F16 as a storage item type because it, and the other substrate-fixed types, implements the parity scale codec. #[pallet::type_value]
pub(super) fn FixedAccumulatorDefaultValue<T: Config>() -> U16F16 { U16F16::from_num(1)
} #[pallet::storage]
#[pallet::getter(fn fixed_value)]
pub(super) type FixedAccumulator<T: Config> = StorageValue<_, U16F16, ValueQuery, FixedAccumulatorDefaultValue<T>>; Next we implement the extrinsic that allows users to update the accumulator by multiplying in a new value. #[pallet::weight(10_000)]
pub fn update_fixed( origin: OriginFor<T>, new_factor: U16F16,
) -> DispatchResultWithPostInfo { ensure_signed(origin)?; let old_accumulated = Self::fixed_value(); // Multiply, handling overflow let new_product = old_accumulated .checked_mul(new_factor) .ok_or(Error::<T>::Overflow)?; // Write the new value to storage FixedAccumulator::<T>::put(new_product); // Emit event Self::deposit_event(Event::FixedUpdated(new_factor, new_product)); Ok(().into())
} This extrinsic is quite similar to the Permill version with one notable difference. Because U16F16 handles numbers greater than one, overflow is possible, and we need to handle it. The error handling here is straightforward, the important part is just that you remember to do it. This example has shown the fundamentals of substrate-fixed, but this library has much more to offer as we'll see in the compounding interest example.

