pub fn add_member(origin: OriginFor<T>) -> DispatchResultWithPostInfo { let new_member = ensure_signed(origin)?; let mut members = Members::<T>::get(); ensure!( members.len() < MAX_MEMBERS, Error::<T>::MembershipLimitReached ); // We don't want to add duplicate members, so we check whether the potential new // member is already present in the list. Because the list is always ordered, we can // leverage the binary search which makes this check O(log n). match members.binary_search(&new_member) { // If the search succeeds, the caller is already a member, so just return Ok(_) => Err(Error::<T>::AlreadyMember.into()), // If the search fails, the caller is not a member and we learned the index where // they should be inserted Err(index) => { members.insert(index, new_member.clone()); Members::<T>::put(members); Self::deposit_event(Event::MemberAdded(new_member)); Ok(().into()) } }
} If it turns out that the caller is not already a member, the binary search will fail. In this case it still returns the index into the Vec at which the member would have been stored had they been present. We then use this information to insert the member at the appropriate location, thus maintaining a sorted Vec.

