{ /// Store all changes made in the underlying storage. fn commit(&self); /// Push an item onto the end of the queue. fn push(&mut self, i: Item); /// Pop an item from the start of the queue. fn pop(&mut self) -> Option<Item>; /// Return whether the queue is empty. fn is_empty(&self) -> bool;
} It defines the usual push, pop and is_empty functions we expect from a queue as well as a commit function that will be used to sync the changes made to the underlying storage.

