The lib.rs file of the pallet shows typical usage of the transient. impl<T: Config> Module<T> { fn queue_transient() -> Box<dyn RingBufferTrait<ValueStruct>> { Box::new(RingBufferTransient::< ValueStruct, <Self as Store>::BufferRange, <Self as Store>::BufferMap, BufferIndex, >::new()) }
} First we define a constructor function (queue_transient) so we don't have to specify the types every time we want to access the transient. This function constructs a ringbuffer transient and returns it as a boxed trait object. See the Rust book's section on trait objects for an explanation of why we need a boxed trait object (defined with the syntax dyn TraitName) when using dynamic dispatch. The add_multiple function shows the actual typical usage of our transient: pub fn add_multiple(origin, integers: Vec<i32>, boolean: bool) -> DispatchResult { let _user = ensure_signed(origin)?; let mut queue = Self::queue_transient(); for integer in integers { queue.push(ValueStruct{ integer, boolean }); } Ok(())
} // commit happens on drop Here we use the queue_transient function defined above to get a queue object. We then push into it repeatedly with commit happening on drop of the queue object at the end of the function. pop works analogously and can of course be intermixed with pushes.

