The child API is abstracted into a few helper functions in the impl<T: Config> Module<T> block. /// Record a contribution in the associated child trie.
pub fn contribution_put(index: FundIndex, who: &T::AccountId, balance: &BalanceOf<T>) { let id = Self::id_from_index(index); who.using_encoded(|b| child::put(&id, b, &balance));
} /// Lookup a contribution in the associated child trie.
pub fn contribution_get(index: FundIndex, who: &T::AccountId) -> BalanceOf<T> { let id = Self::id_from_index(index); who.using_encoded(|b| child::get_or_default::<BalanceOf<T>>(&id, b))
} /// Remove a contribution from an associated child trie.
pub fn contribution_kill(index: FundIndex, who: &T::AccountId) { let id = Self::id_from_index(index); who.using_encoded(|b| child::kill(&id, b));
} /// Remove the entire record of contributions in the associated child trie in a single
/// storage write.
pub fn crowdfund_kill(index: FundIndex) { let id = Self::id_from_index(index); child::kill_storage(&id);
} Because this pallet uses one trie for each active crowdfund, we need to generate a unique ChildInfo for each of them. To ensure that the ids are really unique, we incluce the FundIndex in the generation. pub fn id_from_index(index: FundIndex) -> child::ChildInfo { let mut buf = Vec::new(); buf.extend_from_slice(b"crowdfnd"); buf.extend_from_slice(&index.to_le_bytes()[..]); child::ChildInfo::new_default(T::Hashing::hash(&buf[..]).as_ref())
}

