The dispatchable functions in this pallet follow a standard flow of verifying preconditions, raising appropriate errors, mutating storage, and finally emitting events. We will not present them all in this writeup, but as always, you're encouraged to experiment with the recipe. We will look closely only at the dispense dispatchable which pays the funds to the beneficiary after a successful crowdfund. This dispatchable, as well as dissolve, use an incentivization scheme to encourage users of the chain to eliminate extra data as soon as possible. Data from finished funds takes up space on chain, so it is best to settle the fund and cleanup the data as soon as possible. To incentivize this behavior, the pallet awards the initial deposit to whoever calls the dispense function. Users, in hopes of receiving this reward, will race to call these cleanup methods before each other. /// Dispense a payment to the beneficiary of a successful crowdfund.
/// The beneficiary receives the contributed funds and the caller receives
/// the deposit as a reward to incentivize clearing settled crowdfunds out of storage.
#[pallet::weight(10_000)]
pub fn dispense(origin: OriginFor<T>, index: FundIndex) -> DispatchResultWithPostInfo { let caller = ensure_signed(origin)?; let fund = Self::funds(index).ok_or(Error::<T>::InvalidIndex)?; // Check that enough time has passed to remove from storage let now = <frame_system::Module<T>>::block_number(); ensure!(now >= fund.end, Error::<T>::FundStillActive); // Check that the fund was actually successful ensure!(fund.raised >= fund.goal, Error::<T>::UnsuccessfulFund); let account = Self::fund_account_id(index); // Beneficiary collects the contributed funds let _ = T::Currency::resolve_creating( &fund.beneficiary, T::Currency::withdraw( &account, fund.raised, WithdrawReasons::TRANSFER, ExistenceRequirement::AllowDeath, )?, ); // Caller collects the deposit let _ = T::Currency::resolve_creating( &caller, T::Currency::withdraw( &account, fund.deposit, WithdrawReasons::TRANSFER, ExistenceRequirement::AllowDeath, )?, ); // Remove the fund info from storage <Funds<T>>::remove(index); // Remove all the contributor info from storage in a single write. // This is possible thanks to the use of a child tree. Self::crowdfund_kill(index); Self::deposit_event(Event::Dispensed(index, now, caller)); Ok(().into())
} This pallet also uses the Currency Imbalance trait as discussed in the Charity recipe , to make transfers without incurring transfer fees to the crowdfund pallet itself.

