One drawback of instantiable pallets, as we've presented them so far, is that they require the runtime designer to use the more elaborate syntax even if they only desire a single instance of the pallet. To alleviate this inconvenience, Substrate provides a feature known as DefaultInstance. This allows runtime developers to deploy an instantiable pallet exactly as they would if it were not instantiable provided they only use a single instance . To make your instantiable pallet support DefaultInstance, you must specify it in four places. pub trait Config<I=DefaultInstance>: frame_system::Config { decl_storage! { trait Store for Module<T: Config<I>, I: Instance=DefaultInstance> as TemplateModule { ... }
} decl_module! { pub struct Module<T: Config<I>, I: Instance = DefaultInstance> for enum Call where origin: T::Origin { ... }
} decl_event!( pub enum Event<T, I=DefaultInstance> where ... { ... }
} Having made these changes, a developer who uses your pallet doesn't need to know or care that your pallet is instantable. They can deploy it just as they would any other pallet.
